"use strict";(self.webpackChunkWhaTap_Docs=self.webpackChunkWhaTap_Docs||[]).push([[733],{18033:e=>{e.exports=JSON.parse('{"tag":{"label":"MySQL","permalink":"/tags/my-sql","allTagsPath":"/tags","count":56,"items":[{"id":"mysql/install-agent","title":"Agent Installation","description":"The following guides you to the basic installation method for using the WhaTap database monitoring service.","permalink":"/mysql/install-agent"},{"id":"mysql/set-receive-event","title":"Alert Notification Settings","description":"You can set various functions related to reception of alerts by project members.","permalink":"/mysql/set-receive-event"},{"id":"mysql/set-notice","title":"Alert Settings","description":"You can set event conditions and receive notifications in various forms.","permalink":"/mysql/set-notice"},{"id":"mysql/set-event-detect-anomal","title":"Anomaly detection alert","description":"Alerts can be set to detect a series of behaviors looking for unexpected patterns.","permalink":"/mysql/set-event-detect-anomal"},{"id":"mysql/log-db","title":"Application","description":"It guides you how to collect logs from the database and AWS RDS.","permalink":"/mysql/log-db"},{"id":"mysql/flexboard-template","title":"Application of the template","description":"The following guides you to the preset templates that help you quickly build custom dashboards on Flex Board. You can easily perform initial configuration and change the settings. From selecting a template to naming it, adjusting its layout, and saving the settings, you can effectively create monitoring dashboards.","permalink":"/mysql/flexboard-template"},{"id":"mysql/analysis-count-trend","title":"Comparison between count trends","description":"You can check and compare the database operation trends.","permalink":"/mysql/analysis-count-trend"},{"id":"mysql/agent-settings","title":"Configuration","description":"Learn about additional options you can set through the whatap.conf file on the database agent server.","permalink":"/mysql/agent-settings"},{"id":"mysql/flexboard-create","title":"Creating the Flex board","description":"The following explains how to create a dashboard from the Flex Board menu and place widgets to create a custom dashboard. You can select the fixed layout or responsive layout, add metric widgets, and use predefined widget templates. You can reposition and resize widgets to create your own dashboard layout.","permalink":"/mysql/flexboard-create"},{"id":"mysql/dashboard-intro","title":"Dashboard","description":"The WhaTap monitoring dashboard provides functions to understand the overall status of a project at a glance.","permalink":"/mysql/dashboard-intro"},{"id":"mysql/warning-notice","title":"Database alert","description":"Alerts are sent through event condition settings per metric in the database.","permalink":"/mysql/warning-notice"},{"id":"mysql/analysis-databaseparameter","title":"Database parameters","description":"Parameter values in the database can be viewed and compared by date.","permalink":"/mysql/analysis-databaseparameter"},{"id":"mysql/database-size","title":"Database size","description":"It aggregates the sizes of tables for each database and provides trend data in a chart.","permalink":"/mysql/database-size"},{"id":"mysql/agent-dbx-settings","title":"DBX Agent Setting","description":"It guides you to the options you can set in the whatap.conf file.","permalink":"/mysql/agent-dbx-settings"},{"id":"oracle-v1/agent-dbx-settings","title":"DBX Agent Setting","description":"It guides you to the options you can set in the whatap.conf file.","permalink":"/oracle-v1/agent-dbx-settings"},{"id":"oracle/agent-dbx-settings","title":"DBX Agent Setting","description":"It guides you to the options you can set in the whatap.conf file.","permalink":"/oracle/agent-dbx-settings"},{"id":"mysql/set-event-history","title":"Event History","description":"You can see the history of alerts that occurred through Event History.","permalink":"/mysql/set-event-history"},{"id":"mysql/set-event-format","title":"Event reception format","description":"Learn about the event reception format of alerts provided by database monitoring.","permalink":"/mysql/set-event-format"},{"id":"mysql/warning-notice-v2","title":"Event Setting","description":"Alerts are sent through event condition settings per metric in the database.","permalink":"/mysql/warning-notice-v2"},{"id":"mysql/flex-board","title":"Flex Board","description":"The following guides you to the custom integrated dashboard. You can create real-time dashboards with the data for applications, servers, databases, containers, and more. It provides pre-configured templates. Through the features such as adding various data widgets, data filtering, and setting time ranges, you can easily summarize desired monitoring targets and check important data.","permalink":"/mysql/flex-board"},{"id":"mysql/flexboard-manage","title":"Flex Board Management","description":"The following explains how to edit and manage dashboards in Flex Board. It includes changing the dashboard name, selecting a project, and adjusting the layout for you to see how to add, move, resize, and delete widgets. It also provides the features to select data source for the widget and to export data to json format for the dashboard.","permalink":"/mysql/flexboard-manage"},{"id":"mysql/flexboard-mode","title":"Flex board screen modes","description":"Let\'s learn the provided functions according to the screen mode of the Flex board.","permalink":"/mysql/flexboard-mode"},{"id":"mysql/table-size","title":"Increasing or decreasing the table size","description":"It collects the usage of table and index on a daily basis and provides overall and each table\'s usage increase over time.","permalink":"/mysql/table-size"},{"id":"mysql/after-install-agent","title":"Installation checking items","description":"The database monitoring has been installed completely. Check the checklist after installation.","permalink":"/mysql/after-install-agent"},{"id":"mysql/instance-list","title":"Instance List","description":"You can see the list of database servers in which the agent has been installed.","permalink":"/mysql/instance-list"},{"id":"mysql/labs","title":"Laboratory","description":"The following introduces users about the Lab menu that provides new or experimental features.","permalink":"/mysql/labs"},{"id":"mysql/log-lt","title":"Live Tail","description":"It guides you to Live Tail of the log monitoring.","permalink":"/mysql/log-lt"},{"id":"cubrid/analysis-lock-and-deadlock","title":"Lock tree","description":"You can analyze the lock trend during the day and check deadlocked queries.","permalink":"/cubrid/analysis-lock-and-deadlock"},{"id":"mysql/analysis-lock-and-deadlock","title":"Lock Tree & Dead Lock","description":"You can analyze the lock trend during the day and check deadlocked queries.","permalink":"/mysql/analysis-lock-and-deadlock"},{"id":"mysql/log-main","title":"Log","description":"It guides you to the main menus of the log monitoring.","permalink":"/mysql/log-main"},{"id":"mysql/log-search","title":"Log Search","description":"It guides you to the Log Search menu of Log Monitoring.","permalink":"/mysql/log-search"},{"id":"mysql/log-setting","title":"Log setting","description":"It explains how to set the log monitoring.","permalink":"/mysql/log-setting"},{"id":"mysql/log-exp","title":"Log Trend","description":"It guides you to the Log Trend menu of Log Monitoring.","permalink":"/mysql/log-exp"},{"id":"mysql/agent-manage","title":"Management","description":"Let\'s learn how to update or remove the agent.","permalink":"/mysql/agent-manage"},{"id":"mysql/flexboard-widget-manage","title":"Managing the widgets","description":"The following explains how to add, change, copy, and delete widgets placed on the Flex Board. You can customize the dashboard by adding widgets or adjusting the properties of existing widgets. You can configure a dashboard that suits your monitoring needs through detailed controls such as changing widget data search conditions, setting the time, and setting the data merge options.","permalink":"/mysql/flexboard-widget-manage"},{"id":"mysql/metrics-detect-anormal","title":"Metric Anomaly Detection","description":"You can compare the patterns of various metrics with the expected patterns learned by the AI.","permalink":"/mysql/metrics-detect-anormal"},{"id":"mysql/metrics-intro","title":"Metrics","description":"Let\'s learn about the metrics menus for Database Monitoring analysis.","permalink":"/mysql/metrics-intro"},{"id":"mysql/metric-warning-notice","title":"Metrics alert","description":"Use the metrics event settings to set specific and complex events.","permalink":"/mysql/metric-warning-notice"},{"id":"mysql/flexboard-metric-widget","title":"Metrics widget","description":"The following explains how to add metrics data that represents project performance metrics to the dashboard in the form of widget. Metrics are classified into categories, data can be explored using tags, and are available in two types: table widget and series widget.","permalink":"/mysql/flexboard-metric-widget"},{"id":"mysql/instance-monitoring","title":"Monitoring a Database Instance","description":"In the instance monitoring menu, you can check the information details on key metrics of the database server in real time.","permalink":"/mysql/instance-monitoring"},{"id":"mysql/multi-instance-monitoring","title":"Monitoring Multiple Instances","description":"It provides the function to display the integrated data for key metrics of multiple database instances.","permalink":"/mysql/multi-instance-monitoring"},{"id":"mysql/metrics-data-list","title":"MySQL metrics","description":"It guides you to MySQL metrics.","permalink":"/mysql/metrics-data-list"},{"id":"mysql/monitoring-intro","title":"MySQL Monitoring","description":"The WhaTap database monitoring service (DBX) provides the performance monitoring service by collecting data based on queries.","permalink":"/mysql/monitoring-intro"},{"id":"mysql/mysql-sql-stat","title":"Mysql SQL Statistics","description":"The events_statements_summary_by_digest data in the performance_schema is collected once an hour to provide statistical data. Use it for SQL analysis along with the existing `SQL statistics` menu based on active sessions.","permalink":"/mysql/mysql-sql-stat"},{"id":"mysql/set-notification-message","title":"Notification message customization","description":"It provides the customization function to modify the alert notification messages that are delivered to project members.","permalink":"/mysql/set-notification-message"},{"id":"mysql/log-parser","title":"Parsing the logs","description":"The following guides you to the log parser provided by WhaTap.","permalink":"/mysql/log-parser"},{"id":"mysql/install-agent-quick-setup","title":"Quick agent configuration","description":"You can easily configure the agent by running the setup.sh file among the DBX agent configuration files.","permalink":"/mysql/install-agent-quick-setup"},{"id":"mysql/report-intro","title":"Report","description":"Let\'s learn about the documents that report the service usage and failure records for individual projects.","permalink":"/mysql/report-intro"},{"id":"mysql/set-event-log","title":"Setting the Log Alert","description":"It introduces the log event alert menus.","permalink":"/mysql/set-event-log"},{"id":"mysql/flexboard-share","title":"Sharing the Flex board","description":"The Flex board can be shared and reused by the users with other accounts.","permalink":"/mysql/flexboard-share"},{"id":"mysql/slow-query","title":"Slow Query","description":"You can analyze slow queries after identifying active sessions at a specific time point.","permalink":"/mysql/slow-query"},{"id":"mysql/stat","title":"SQL Statistics","description":"It provides the statistical data for each MySQL DB.","permalink":"/mysql/stat"},{"id":"mysql/monitoring-support","title":"Support Environment","description":"Before monitoring the database, learn about the supported database types.","permalink":"/mysql/monitoring-support"},{"id":"mysql/analysis-compare-top-sql","title":"Top SQL Comparison","description":"You can compare the SQL trends in the time zone set based on a specific date and check their fluctuations.","permalink":"/mysql/analysis-compare-top-sql"},{"id":"mysql/troubleshooting","title":"Troubleshooting","description":"You can check the problems that may occur during database agent installation.","permalink":"/mysql/troubleshooting"},{"id":"mysql/agent-xos-settings","title":"XOS agent configuration","description":"It provides a configuration method for additional monitoring of the database server resources.","permalink":"/mysql/agent-xos-settings"}],"unlisted":false}}')}}]);